import random
from os import path

file_name = "task_1_storage.txt"


def write_to_file(file_path: str) -> None:
    if path.exists(file_path):
        mode = "w"
    else:
        mode = "x+"

    with open(file_path, mode) as file:
        values = [random.randint(0, 100) for i in range(10000)]
        print(f"Check sum before write: {sum(values)}")
        file.write(str(values))

    # file = open(file_path, mode)
    # values = [random.randint(0, 100) for i in range(10000)]
    # print(f"Check sum before write: {sum(values)}")
    # file.write(str(values))
    #
    # file.close()
    #
    ...


def get_sum_from_file(file_path: str) -> int:
    with open(file_path, 'r') as file:
        values_str_repr = file.read()
        values = [int(value) for value in values_str_repr[1:-1].split(',')]
    return sum(values)


write_to_file(file_name)
result = get_sum_from_file(file_name)
print(result)


